import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <nav style={{ backgroundColor: '#333', padding: '10px' }}>
            <ul style={{ listStyleType: 'none', padding: 0, margin: 0, display: 'flex', justifyContent: 'space-around' }}>
                <li><Link to="/main" style={{ color: '#fff', textDecoration: 'none' }}>Main</Link></li>
                <li><Link to="/monitor" style={{ color: '#fff', textDecoration: 'none' }}>Monitoring</Link></li>
                <li><Link to="/map_create" style={{ color: '#fff', textDecoration: 'none' }}>Map Create</Link></li>
                <li><Link to="/map_upload" style={{ color: '#fff', textDecoration: 'none' }}>Map Upload</Link></li>
                <li><Link to="/robot_register" style={{ color: '#fff', textDecoration: 'none' }}>Robot Register</Link></li>
                {/* <li><Link to="/control" style={{ color: '#fff', textDecoration: 'none' }}>Control</Link></li> */}
                {/* <li><Link to="/logs" style={{ color: '#fff', textDecoration: 'none' }}>Logs</Link></li> */}
                {/* 다른 네비게이션 링크들 */}
            </ul>
        </nav>
    );
}

export default Navbar;
